#
# Table structure for table 'auct_board'
#

CREATE TABLE auct_board (
  num int(11) NOT NULL auto_increment,
  user_id varchar(12) NOT NULL default '',
  auction_code_fk varchar(10) NOT NULL default '',
  subject varchar(150) NOT NULL default '',
  contents text,
  re_cnt int(11) NOT NULL default '0',
  wdate date NOT NULL default '0000-00-00',
  PRIMARY KEY  (num),
  KEY user_id_id (user_id)
) TYPE=MyISAM;

