#
# Table structure for table 'auct_master'
#

CREATE TABLE auct_master (
  anum int(11) NOT NULL auto_increment,
  category_fk varchar(5) NOT NULL default '',
  prod_name varchar(30) NOT NULL default '',
  prod_type char(1) NOT NULL default '1',
  in_addr varchar(10) default NULL,
  phone varchar(15) default NULL,
  addr varchar(10) default NULL,
  as_type char(1) NOT NULL default 'Y',
  start_amt int(11) NOT NULL default '0',
  limit_type char(1) NOT NULL default '1',
  limit_amt int(11) NOT NULL default '0',
  limit_cnt int(5) NOT NULL default '0',
  join_amt int(11) NOT NULL default '0',
  join_cnt int(5) NOT NULL default '0',
  curr_amt int(11) NOT NULL default '0',
  total_cnt int(11) NOT NULL default '0',
  auct_start varchar(14) NOT NULL default '',
  auct_end varchar(14) NOT NULL default '',
  trans_type char(1) NOT NULL default '1',
  prod_img varchar(50) NOT NULL default '',
  con_html char(1) NOT NULL default '1',
  contents text,
  reg_date date default NULL,
  end_chk char(1) NOT NULL default 'N',
  delete_chk char(1) NOT NULL default 'N',
  PRIMARY KEY  (anum),
  KEY category_fk (category_fk),
  KEY end_chk (end_chk)
) TYPE=MyISAM;

